import React, { useState } from "react";
import "./Teams.css";

function MenuButton({
    text,
    color,
    selected,
    onClick,
  }: {
    text: ButtonText;
    color: ButtonStyle["backgroundColor"];
    selected: boolean;
    onClick: () => void;
  }) {
    const buttonStyle: ButtonStyle = {
      backgroundColor: selected ? "#DA55BD" : color, // Toggles button color when selected
    };

    return (
      <button
        className="menu-button"
        style={buttonStyle}
        onClick={onClick}
        aria-selected={selected}
      >
        {text}
      </button>
    );
  }

export default function Teams() {
    const [person, setPerson] = useState<String>('');

    const onClick = (name: String) => {
        setPerson(name);
    }

  return (
    <div className="team-list">
      <div className="team-container">
        <div className="team-content">
          <div className="team-header">TEAM 1 TOTAL POINTS</div>
          <div className="points">
            <div className="current">1000</div>
            <div className="max">/ 9700</div>
          </div>
          <div className="members">
            <button className="person">Michael</button>
            <button className="person">Kevin</button>
            <button className="person">Bob</button>
            <button className="person">Larissa</button>
            <button className="person">Gabby</button>
          </div>
        </div>
      </div>
      <div className="team-container">
        <div className="team-content">
          <div className="team-header">TEAM 2 TOTAL POINTS</div>
          <div className="points">
            <div className="current">1000</div>
            <div className="max">/ 9700</div>
          </div>
          <div className="members">
            <button className="person">Michael</button>
            <button className="person">Kevin</button>
            <button className="person">Bob</button>
            <button className="person">Larissa</button>
            <button className="person">Gabby</button>
          </div>
        </div>
      </div>
      <div className="team-container">
        <div className="team-content">
          <div className="team-header">TEAM 3 TOTAL POINTS</div>
          <div className="points">
            <div className="current">1000</div>
            <div className="max">/ 9700</div>
          </div>
          <div className="members">
            <button className="person" onClick={() => onClick('Michael')}>Michael</button>
            <button className="person" onClick={() => onClick('Kevin')}>Kevin</button>
            <button className="person" onClick={() => onClick('Bob')}>Bob</button>
            <button className="person" onClick={() => onClick('Larissa')}>Larissa</button>
            <button className="person" onClick={() => onClick('Gabby')}>Gabby</button>
          </div>
        </div>
      </div>
    </div>
  );
}
